class Solution {
public:
    int findMinimumOperations(string s1, string s2, string s3) {
        // The strategy is to keep reducing the strings from the right until all are of the same length
        // Then compare each character from left to right
        while (true) {
            // Find the minimum length among the three strings
            int minLen = min({s1.length(), s2.length(), s3.length()});
            // Reduce the strings to the minimum length
            if (s1.length() > minLen) s1.pop_back();
            if (s2.length() > minLen) s2.pop_back();
            if (s3.length() > minLen) s3.pop_back();

            // If all strings are of equal length, break the loop
            if (s1.length() == minLen && s2.length() == minLen && s3.length() == minLen) break;
        }

        // Check if all characters are same from the start for the strings of equal length
        for (int i = 0; i < s1.length(); ++i) {
            if (s1[i] != s2[i] || s1[i] != s3[i]) return -1; // If any character is different, return -1
        }

        // If all characters are same, the operation count is the sum of differences in original lengths and final length
        return (s1.length() + s2.length() + s3.length()) - 3 * s1.length();
    }
};
